// client/src/components/Privacy.js
import React from 'react';

const Privacy = () => {
  return (
    <div className="page-container">
      <div className="hero">
        <h1>Privacy Policy</h1>
        <p>How we protect and handle your data</p>
      </div>
    </div>
  );
};

export default Privacy;
